import './Layout.css'
import Nav from '../navigation/Navigation.jsx'
import Footer from '../footer/Footer.jsx'

const Layout = () => {
  return (
    <div className='layout'>
    <Nav />
    <div className="layout-children">
        {props.children}
    </div>
<Footer user={props.user}/>
</div>
  );
}

export default Layout;
